import ButtonSimple from "../../components/buttons/buttonSimple";

export default function Buttons() {
  return (
    <S.Container>
      <h1>Botoes</h1>
      <ButtonSimple
        title="Button Simple"
        bgColor=""
        bgColorActive="pink"
        colorFont=""
        colorFontActive="#fff"
        width="200px"
        height=""
        radius=""
        fontSize=""
        padding=""
        shadow=""
      />
    </S.Container>
  );
}
